from typing import List
import heapq

class Solution:
    def lexicographicallySmallestArray(self, nums: List[int], limit: int) -> List[int]:
        n = len(nums)
        result = nums[:]
        for i in range(n):
            min_heap = []
            for j in range(i, n):
                if abs(nums[i] - nums[j]) <= limit:
                    heapq.heappush(min_heap, (nums[j], j))
            while min_heap:
                _, idx = heapq.heappop(min_heap)
                if idx > i:
                    result[i], result[idx] = result[idx], result[i]
                    break
        return result
